import axios from "axios";

const feature = (url, method, type = "json") => {
  switch (method) {
    case "get":
      axios(url, { responseType: type });
      break;
    case "post":
      console.log("get");
      break;
    case "put":
      console.log("get");
      break;
    case "delete":
      console.log("get");
      break;
    default:
      console.log("not");
      break;
  }
};

export default feature;
